import React from 'react';

class ImageCard extends React.Component {
    render() {
        console.log(this.props.image);
        return (
            <div>
                <img alt={this.props.image.description} src={this.props.image.urls.regular} />
            </div>
        );
    }
}

export default ImageCard;
